import React from 'react';
import { Bar, BarChart, CartesianGrid, Legend, Tooltip, XAxis, YAxis } from 'recharts';
const Rechart = ({ tq }) => {
    const { id, name, total } = tq;
    console.log(tq);
    const data1 = [
        {
            "name": { name },
            "uv": { total },
            "pv": 2400
        },
        {
            "name": "Page B",
            "uv": 3000,
            "pv": 1398
        },
        {
            "name": "Page C",
            "uv": 2000,
            "pv": 9800
        },
        {
            "name": "Page D",
            "uv": 2780,
            "pv": 3908
        }

    ]
    return (
        <div>
            <BarChart width={730} height={250} data1={data1}>
                <CartesianGrid strokeDasharray="4 4" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="pv" fill="blue" />
                <Bar dataKey="uv" fill="orange" />
            </BarChart>
        </div>
    );
};

export default Rechart;
